import * as ActionTypes from './ActionTypes';

export const Feedbacks = (state = {
    errMess: null,
    feedbacks: []
}, action) => {
    switch (action.type) {
        case ActionTypes.ADD_FEEDBACKS:
            var feedbacks = action.payload;
            return { ...state, feedbacks: state.feedbacks.concat(feedbacks) };

        default:
            return state;
    }
};
